import React from "react";
import styled from "styled-components";

function ResultSection() {
  return (
    <Section>
      <ResultContent>
        <ResultTitle>Result</ResultTitle>
        <AnimalName>Kangaroo</AnimalName>
        <ResultDescription>
          At Clever, we securely connect the data and applications that schools
          rely on to make digital learning work. Hi Patricia, I'm a UX designer
          with experience in startup environments, designing hi-fi prototypes
          using Figma and Adobe CC. I found a UI/UX designer position at SFM
          that fits my profile. I would be eager to discuss how my skills align
          with this role. My work is at https://www.vrushikmehta.com/.
        </ResultDescription>
      </ResultContent>
      <ImageWrapper>
        <ResultImage src="https://cdn.builder.io/api/v1/image/assets/TEMP/e4ad37739d944f5f414def5bd4716ea6d722c77f6d9bea9f31661b892242851b?apiKey=e3765372b84f44f7af794f9207eac8b0&" alt="Result" />
      </ImageWrapper>
    </Section>
  );
}

const Section = styled.section`
  display: flex;
  align-self: center;
  margin-top: 74px;
  width: 100%;
  max-width: 1106px;
  gap: 20px;

  @media (max-width: 991px) {
    flex-direction: column;
    align-items: stretch;
    max-width: 100%;
    margin-top: 40px;
  }
`;

const ResultContent = styled.div`
  display: flex;
  flex-direction: column;
  font-size: 32px;
  color: var(--Color, #162407);
  letter-spacing: -2.04px;
  padding: 0 20px;
  width: 50%;

  @media (max-width: 991px) {
    width: 100%;
    max-width: 100%;
    margin-top: 40px;
  }
`;

const ResultTitle = styled.h2`
  font-family: Manrope, sans-serif;
  font-weight: 500;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const AnimalName = styled.h3`
  font-family: Manrope, sans-serif;
  font-weight: 600;
  margin-top: 46px;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-top: 40px;
  }
`;

const ResultDescription = styled.p`
  letter-spacing: -0.26px;
  margin-top: 13px;
  font: 400 16px Manrope, sans-serif;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const ImageWrapper = styled.div`
  width: 50%;
  margin-left: 20px;

  @media (max-width: 991px) {
    width: 100%;
    margin-left: 0;
  }
`;

const ResultImage = styled.img`
  aspect-ratio: 1.1;
  object-fit: cover;
  width: 100%;
  margin-top: 59px;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-top: 40px;
  }
`;

export default ResultSection;
